  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fort Niobrara
  National Wildlife Refuge outlines Refuge accomplishments from September through
  December of 1959. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  fish, reptiles, and disease- is also covered. The Refuge development and maintenance
  section discusses physical developments, plantings, collections and receipts, and
  fires. Resource management is outlined; topics include grazing and haying. A progress
  report on field investigations and applied research is also provided. The public
  relations section of the report describes recreational uses, Refuge visitors, Refuge
  participation, hunting, and violations. Items of interest are discussed, and photographs
  and N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
